create database banking;
use banking;
desc customers;
drop database banking;
create table customers(
			customer_id int null,customer_name varchar(25) not null,customber_date_of_brith date not null,
			customer_account_number varchar(30) ,customer_bank_name varchar (25) not null,
            customer_ifsc_code varchar (25) not null,customer_pan_number varchar(25) not null,
            customer_adhadhar_number bigint not null,customer_email_id varchar(45) not null,
			customer_phone_no bigint not null,customer_address text not null ,
			customer_nationality enum('indian') not null,customer_gender enum('male','female') not null,
            customer_account_type enum('current','saving') not null,
            customer_account_status enum('active','inactive') not null,
primary key (customer_account_number),
unique(customer_account_number),
unique(customer_pan_number),
unique(customer_adhadhar_number),
unique(customer_email_id),
unique(customer_phone_no),
check (customer_gender in ('male','female')));




